package java1_04;

public class OpEx07 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(10==10 && 3==3);
		System.out.println(10!=10 && 3==3);
		System.out.println(10==10 && 3!=3);
		System.out.println(10!=10 && 3!=3);
		
		System.out.println();
		
		System.out.println(10==10 || 3==3);
		System.out.println(10!=10 || 3==3);
		System.out.println(10==10 || 3!=3);
		System.out.println(10!=10 || 3!=3);
	}	

}
